Stunning and bizarre Vogue moment, as fascinating today as it was when published: model in Revlon fake eyelashes and makeup, photo by Bert Stern in the November 1st 1965 issue, from my collection.
'Eyes with an ... look grew from the colours within an extraordinary length of snakeskin—mauve, avocado, pistachio, brass. "Snake Eyes", the proposition put to Revlon's special makeup man, Stan Lawrence, thus became this: mauve and pistachio eyelids; down-turned fake eyelashes. All, devised to show the extremes to which the exciting premise of a whitened face. Fake eyelashes (upturned, and of unusual longevity) are also Revlon news—the first batch of the long-awaited fakes perfected by Revlon will reach shops in the U.S.A. this month. Mauvesse foundation, under Revlon's Ultima label, is in shops now. Hood, in a Fleming-Joffe leather, made by Adolfo.'
